// Here we simply load the dataset into Spark, register it as a table so that we can query it from Spark SQL, and print the schema of the dataframe we have obtained.
// As seen in the schema, there are a lot of columns that we will not use for the questions which means that we should manually define the schema we will use to avoid carrying

all that useless data around.
val businesses = spark.read.format("json").load("file:///tmp/yelp_academic_dataset_business.json")
businesses.createOrReplaceTempView("businesses")
businesses.printSchema
